import React from "react";
import "./Filter.css";
import ReactScrollbar from 'react-scrollbar-js';

export default function Filter() {
    return (
        <ReactScrollbar>
            <div className="container-filter" style={{height: '200px', overflow: 'hidden'}}>
                <p>And Now</p>
                <p>You Can Put</p>
                <p>A Long Content Here</p>
            </div>
        </ReactScrollbar>
    );
}
